```python
import numpy as np
import random

# Define functions for generating each feature
def generate_target_thickness():
    return np.random.uniform(low=0, high=125)

def generate_pulse_width():
    return np.random.normal(loc=300, scale=np.sqrt(1030000))

def generate_energy():
    energy = 13.9
    if random.uniform(low=0, high=1) < 0.5:
        energy *= np.random.uniform(low=0.9, high=1.1)
    else:
        energy += np.random.normal(loc=0, scale=np.sqrt(2350))
    return energy

def generate_spot_size():
    return np.random.uniform(low=2.13, high=60)

def generate_intensity():
    intensity = 5.10e20
    intensity *= np.random.uniform(low=np.exp(-0.7), high=np.exp(0.3))
    return intensity

def generate_power():
    power = 6.23e13
    if random.uniform(low=0, high=1) < 0.5:
        power *= np.random.uniform(low=np.exp(-0.5), high=np.exp(0.5))
    else:
        power += np.random.normal(loc=0, scale=np.sqrt(403e27))
    return power

def generate_cutoff_energy():
    cutoff_energy = 8.64
    if random.uniform(low=0, high=1) < 0.5:
        cutoff_energy *= np.random.uniform(low=np.exp(-0.3), high=np.exp(0.3))
    else:
        cutoff_energy += np.random.normal(loc=0, scale=np.sqrt(156))
    return cutoff_energy

def generate_sample():
    target_material = random.choice(['aluminium', 'gold', 'plastic'])
    target_thickness = generate_target_thickness()
    pulse_width = generate_pulse_width()
    energy = generate_energy()
    spot_size = generate_spot_size()
    intensity = generate_intensity()
    power = generate_power()
    cutoff_energy = generate_cutoff_energy()
    return [target_material, target_thickness, pulse_width, energy, spot_size, intensity, power, cutoff_energy]

# Generate 25 new data points
data_points = []
for i in range(25):
    sample = generate_sample()
    data_points.append(sample)

print(data_points)
```

